import { useState } from 'react';
import styles from './BusinessCardLeadView.module.css';

const BusinessCardLeadView = (props) => {
    const [keys, setKeys] = useState(props.keys);
   if(keys) {
       setKeys(()=>{
           return Object.keys(props.keys);

       });
   }
    return <div className={styles.leadTopDetails}>
                <p style={{padding: "1rem", fontWeight: "bold", fontSize:"1rem", color: "#313949"}}>Business Card View:</p>
            </div>

}

export default BusinessCardLeadView;
